import { createSlice, createAsyncThunk } from '@reduxjs/toolkit';
import {
  collection,
  addDoc,
  getDocs,
  deleteDoc,
  doc,
  updateDoc,
  orderBy,
  query,
  where
} from 'firebase/firestore';
import { db } from '../../Config/firebaseConfig';



// Async thunks for Firebase operations
export const fetchCertificates = createAsyncThunk(
  'certificate/fetchCertificates',
  async (_, { rejectWithValue }) => {
    try {
      const q = query(
        collection(db, 'certificates'),
        orderBy('createdAt', 'desc')
      );
      const querySnapshot = await getDocs(q);

      const certificates = querySnapshot.docs.map(doc => ({
        id: doc.id,
        ...doc.data()
      }));

      return certificates;
    } catch (error) {
      console.error('Error fetching certificates:', error);
      return rejectWithValue(error.message);
    }
  }
);

export const addCertificate = createAsyncThunk(
  'certificate/addCertificate',
  async (certificateData, { rejectWithValue }) => {
    try {
      const docRef = await addDoc(collection(db, 'certificates'), {
        ...certificateData,
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString()
      });

      return {
        id: docRef.id,
        ...certificateData,
        createdAt: new Date().toISOString(),
        updatedAt: new Date().toISOString()
      };
    } catch (error) {
      console.error('Error adding certificate:', error);
      return rejectWithValue(error.message);
    }
  }
);

export const updateCertificate = createAsyncThunk(
  'certificate/updateCertificate',
  async ({ id, data }, { rejectWithValue }) => {
    try {
      const certificateRef = doc(db, 'certificates', id);
      const updateData = {
        ...data,
        updatedAt: new Date().toISOString()
      };

      await updateDoc(certificateRef, updateData);

      return {
        id,
        ...updateData
      };
    } catch (error) {
      console.error('Error updating certificate:', error);
      return rejectWithValue(error.message);
    }
  }
);

export const deleteCertificate = createAsyncThunk(
  'certificate/deleteCertificate',
  async (certificateId, { rejectWithValue }) => {
    try {
      await deleteDoc(doc(db, 'certificates', certificateId));
      return certificateId;
    } catch (error) {
      console.error('Error deleting certificate:', error);
      return rejectWithValue(error.message);
    }
  }
);

export const searchCertificates = createAsyncThunk(
  'certificate/searchCertificates',
  async ({ searchTerm, category }, { rejectWithValue }) => {
    try {
      let q = query(collection(db, 'certificates'));

      if (category && category !== 'All') {
        q = query(q, where('category', '==', category));
      }

      const querySnapshot = await getDocs(q);
      let certificates = querySnapshot.docs.map(doc => ({
        id: doc.id,
        ...doc.data()
      }));

      // Client-side filtering for text search
      if (searchTerm) {
        certificates = certificates.filter(cert =>
          cert.name?.toLowerCase().includes(searchTerm.toLowerCase()) ||
          cert.organization?.toLowerCase().includes(searchTerm.toLowerCase()) ||
          cert.category?.toLowerCase().includes(searchTerm.toLowerCase())
        );
      }

      return certificates;
    } catch (error) {
      console.error('Error searching certificates:', error);
      return rejectWithValue(error.message);
    }
  }
);

